    public class Misc : ThreadedServiceBase
    {
        private GameProcess GameProcess { get; set; }
        private GameData GameData { get; set; }

        public Misc(GameProcess gameProcess, GameData gameData)
        {
            GameProcess = gameProcess;
            GameData = gameData;
        }

        protected override string ThreadName => nameof(Misc);

        public override void Dispose()
        {
            base.Dispose();
            GameData = null;
            GameProcess = null;
        }

        private static int hit = 0;
        protected override void FrameAction()
        {
            /*
            if (!GameProcess.IsValid || !GameData.Player.IsAlive()) return;

            IntPtr localPlayerPawn = GameProcess.Process.Read<IntPtr>(GameData.Player.AddressBase + Offsets.dwLocalPlayerPawn); 

            IntPtr ObserverServices = GameProcess.Process.Read<IntPtr>(GameData.Player.AddressBase + 0x1110);

            int observerInt = GameProcess.Process.Read<int>(ObserverServices + 0x40);

            Console.WriteLine(observerInt);

            GameProcess.Process.Write<int>(ObserverServices + 0x40, 3);
            */

            /*
    DWORD64 m_Glow= 0xBA0;
    DWORD64 m_glowColorOverride = 0x40;
    DWORD64 m_bGlowing = 0x51;
     
    DWORD64 GlowColorOverride = pawn + m_Glow + m_glowColorOverride;
    DWORD64 GlowFunction = pawn + m_Glow + m_bGlowing;
     
    write(GlowColorOverride, 0x800000FF); //you can use any color you want (ARGB)
    write(GlowFunction, 1);

            */




            if (!GameProcess.IsValid || !GameData.Player.IsAlive()) return;


            IntPtr CPlayer_CameraServices = GameProcess.Process.Read<IntPtr>(GameData.Player.AddressBase + 0x1130);

            int currentFov = GameProcess.Process.Read<int>(CPlayer_CameraServices + 0x210); // m_iFOV


            if (!GameData.Player.isScoped && currentFov != config.config.i_m_fov)
            {
                GameProcess.Process.Write<int>(CPlayer_CameraServices + 0x210, config.config.i_m_fov);
            }
            
            

            
            
            IntPtr CCSPlayer_BulletServices = GameProcess.Process.Read<IntPtr>(GameData.Player.AddressBase + 0x1468);
            int hits = GameProcess.Process.Read<int>(CCSPlayer_BulletServices + 0x40);

            if (hits != hit)
            {
                if (hits != 0)
                {
                    if (config.config.hitsound)
                    {
                        Task.Run(() => PlayWavFromByteArray(Convert.FromBase64String("")));


                    }

                }
                hit = hits;
            }

            if (config.config.b_e_glow || config.config.b_t_glow)
            {
                foreach (Entity entity in GameData.Entities)
                {
                    if (entity.AddressBase != GameData.Player.AddressBase)
                    {
                        if (config.config.b_e_glow)
                        {
                            if (entity.Team != GameData.Player.Team)
                            {
                                IntPtr GlowColorOverride = entity.AddressBase + Offsets.m_Glow + 0x40;
                                IntPtr GlowFunction = entity.AddressBase + Offsets.m_Glow + 0x51; //bGlowing

                                GameProcess.Process.Write<uint>(GlowColorOverride, config.config.enemyGlowColor); // color
                                GameProcess.Process.Write<int>(GlowFunction, 1);

                            }

                        }

                        if (config.config.b_t_glow)
                        {
                            if (entity.Team == GameData.Player.Team)
                            {
                                IntPtr GlowColorOverride = entity.AddressBase + Offsets.m_Glow + 0x40;
                                IntPtr GlowFunction = entity.AddressBase + Offsets.m_Glow + 0x51; //bGlowing

                                GameProcess.Process.Write<uint>(GlowColorOverride, config.config.teamGlowColor); // color
                                GameProcess.Process.Write<int>(GlowFunction, 1);

                            }

                        }



                    }

                }
            }




        }

        public void PlayWavFromByteArray(byte[] wavData)
        {
            try
            {
                // Check if the byte array contains any data
                if (wavData == null || wavData.Length == 0)
                {
                    throw new ArgumentException("The provided byte array is null or empty.");
                }

                using (MemoryStream stream = new MemoryStream(wavData))
                {
                    // Create a SoundPlayer instance with the memory stream containing the WAV data
                    using (SoundPlayer player = new SoundPlayer(stream))
                    {
                        // Play the WAV file
                        player.Play();
                    }
                }
            }
            catch (Exception e)
            {
                MessageBox.Show(e.ToString());
            }
        }
    }
}